(15001, '追风筝的人', '\"\"', '\"\"', '\"\"', '9787208061644', '\"\"', '上海人民出版社', '2011-12-26', 'ZZZ', '', '[\"[阿富汗] 卡勒德·胡赛尼 \"]', '[]', '', '', '', 29, 362, 500, '12岁的阿富汗富家少爷阿米尔与仆人哈桑情同手足。然而，在一场风筝比赛后，发生了一件悲惨不堪的事，阿米尔为自己的懦弱感到自责和痛苦，逼走了哈桑，不久，自己也跟随父亲逃往美国。\r\n成年后的阿米尔始终无法原谅自己当年对哈桑的背叛。为了赎罪，阿米尔再度踏上暌违二十多年的故乡，希望能为不幸的好友尽最后一点心力，却发现一个惊天谎言，儿时的噩梦再度重演，阿米尔该如何抉择？\r\n故事如此残忍而又美丽，作者以温暖细腻的笔法勾勒人性的本质与救赎，读来令人荡气回肠。\r\n', '第一章\r\n第二章\r\n第三章\r\n第四章\r\n第五章\r\n第六章', '谨以此书献给哈里斯和法拉，他们为我启蒙。献给所有阿富汗的孩子。 我成为今天的我，是在1975年某个阴云密布的寒冷冬日，那年我十二岁。我清楚地记得当时自己趴在一堵坍塌的泥墙后面，窥视着那条小巷，旁边是结冰的小溪。许多年过去了，人们说陈年旧事可以被埋葬，然而我终于明白这是错的，因为往事会自行爬上来。回首前尘，我意识到在过去二十六年里，自己始终在窥视着那荒芜的小径。 今...', '{\"small\":\"https://www.library-online.cn/imgs/9787208061644.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:05:58', NULL),
(15002, '百年孤独', '\"\"', '\"\"', '\"\"', '9787544253994', '\"\"', '南海出版公司', '1992-04-17', 'ZZZ', '', '[\"[哥伦比亚] 加西亚·马尔克斯 \"]', '[]', '', '', '', 39.5, 360, 600, '《百年孤独》是魔幻现实主义文学的代表作，描写了布恩迪亚家族七代人的传奇故事，以及加勒比海沿岸小镇马孔多的百年兴衰，反映了拉丁美洲一个世纪以来风云变幻的历史。作品融入神话传说、民间故事、宗教典故等神秘因素，巧妙地糅合了现实与虚幻，展现出一个瑰丽的想象世界，成为20世纪最重要的经典文学巨著之一。1982年加西亚•马尔克斯获得诺贝尔文学奖，奠定世界级文学大师的地位，很大程度上乃是凭借《百年孤独》的巨大影响。', '', '每个人都是孤独地出生，在这世间恍惚几十年并不漫长的日子转眼就远去了，然后再孤独地死去。 生命注定是个悲剧，因为我们从没有融入世界，世界永远是身外之物。如果有幸，能在茫茫人海寻得一个身体与灵魂都与自己万分契合的人，与之存在一种可以称之为爱情的联系，然后一起承受生命中不可逃离不可消除的深沉的宿命的孤独。可是这般的幸运艰深难得。有的已失去了爱的能力，有的爱的深沉却无处安放，有的死在这爱里……在所有的爱里，孤独有增无减。 生命只是一场幻梦。', '{\"small\":\"https://www.library-online.cn/imgs/9787544253994.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:05:58', NULL),
(15003, '雪落香杉树', '\"\"', '\"\"', '\"\"', '9787506387873', '\"\"', '作家出版社', '1998-09-25', 'ZZZ', '', '[\"[美] 戴维·伽特森 \"]', '[]', '', '', '', 52, 370, 610, '编辑推荐:\r\n1995福克纳奖得主\r\n占据《纽约时报》畅销榜首数月\r\n美国书商协会年度之选\r\n被译成30余种文字，全球畅销500万册\r\n当代美国文学史上罕见的超级畅销获奖经典\r\n全美大中学文学课堂读本，被列入大学文学课程考试大纲\r\n拥有哈罗德•布鲁姆和Cliff Notes等众多导读本\r\n恢弘精妙，融爱情、战争、历史、悬疑和成长小说于一体\r\n多次被改编成电影和舞台剧，同名电影由伊桑霍克和工藤夕贵主演\r\n内容简介：\r\n一位默默无闻的美国中学教师，用十年时间写下令自己一夜成名的故事，虚构了西雅图附近一座香杉积翠，草莓遍地的海岛，一处被海水封闭的小型人世，交织上演着爱情、战争、种族歧视和悬疑谋杀案……\r\n日裔少女初枝的生活中先后到来两个男人：邻居男孩伊什梅尔是她的初恋，他们气息相通；暗恋她并*终成为她丈夫的日本同学宫本天道，他们血脉相连。珍珠港事件爆发，日美矛盾空前激化，日裔居民...', '', '', '{\"small\":\"https://www.library-online.cn/imgs/9787506387873.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:05:58', NULL),
(15004, '霍乱时期的爱情', '\"\"', '\"\"', '\"\"', '9787544258975', '\"\"', '南海出版公司', '2010-04-09', 'ZZZ', '', '[\"[哥伦比亚] 加西亚·马尔克斯 \"]', '[]', '', '', '', 39.5, 401, 674, '★马尔克斯唯一正式授权，首次完整翻译\r\n★《霍乱时期的爱情》是我最好的作品，是我发自内心的创作。——加西亚•马尔克斯\r\n★这部光芒闪耀、令人心碎的作品是人类有史以来最伟大的爱情小说。——《纽约时报》\r\n《霍乱时期的爱情》是加西亚•马尔克斯获得诺贝尔文学奖之后完成的第一部小说。讲述了一段跨越半个多世纪的爱情史诗，穷尽了所有爱情的可能性：忠贞的、隐秘的、粗暴的、羞怯的、柏拉图式的、放荡的、转瞬即逝的、生死相依的……再现了时光的无情流逝，被誉为“人类有史以来最伟大的爱情小说”，是20世纪最重要的经典文学巨著之一。', '', '', '{\"small\":\"https://www.library-online.cn/imgs/9787544258975.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:05:58', NULL),
(15005, '月亮和六便士', '\"\"', '\"\"', '\"\"', '9787532739547', '\"\"', '上海译文出版社', '2007-02-18', 'ZZZ', '', '[\"[英] 威廉·萨默塞特·毛姆 \"]', '[]', 'wiki测试作者简介。', '', '', 15, 275, 430, '一个英国证券交易所的经纪人，本已有牢靠的职业和地位、美满的家庭，但却迷恋上绘画，像“被魔鬼附了体”，突然弃家出走，到巴黎去追求绘画的理想。他的行径没有人能够理解。他在异国不仅肉体受着贫穷和饥饿煎熬，而且为了寻找表现手法，精神亦在忍受痛苦折磨。经过一番离奇的遭遇后，主人公最后离开文明世界，远遁到与世隔绝的塔希提岛上。他终于找到灵魂的宁静和适合自己艺术气质的氛围。他同一个土著女子同居，创作出一幅又一幅使后世震惊的杰作。\n在他染上麻风病双目失明之前，曾在自己住房四壁画了一幅表现伊甸园的伟大作品。但在逝世之前，他却命令土著女子在他死后把这幅画作付之一炬。通过这样一个一心追求艺术、不通人性世故的怪才，毛姆探索了艺术的产生与本质、个性与天才的关系、艺术家与社会的矛盾等等引人深思的问题。同时这本书也引发了人们对摆脱世俗束缚逃离世俗社会寻找心灵家园这一话题的思考，而关于南太平洋小岛的自然民风的描写也引人向往。\n《月亮和六便士》说问世后，以情节入胜、文字深刻在文坛轰动一时，人们争相传看。在小说中，毛姆用第一人称的叙述手法，借“我”之口，叙述整个故事，有人认为这篇小说的原型是法国印象派画家高更，这更增加了它的传奇色彩，受到了全世界读者的关注。', '五十八节', '', '{\"small\":\"https://www.library-online.cn/imgs/9787532739547.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL),
(15006, '杀死一只知更鸟', '\"\"', '\"\"', '\"\"', '97875399898921', '\"\"', '译林出版社', '1992-05-19', 'ZZZ', '', '[\" [美] 哈珀·李 \"]', '[]', '', '', '', 32, 346, 531, '成长总是个让人烦恼的命题。成长有时会很缓慢，如小溪般唱着叮咚的歌曲趟过，有时却如此突如其来，如暴雨般劈头盖脸……三个孩子因为小镇上的几桩冤案经历了猝不及防的成长——痛苦与迷惑，悲伤与愤怒，也有温情与感动。这是爱与真知的成长经典。\r\n《杀死一只知更鸟》获1961年普利策奖。\r\n美国图书馆借阅率最高的书，英国青少年最喜爱的小说之一。\r\n美国中学推荐课外读物。\r\n由小说改编的电影获第25届奥斯卡三项大奖。\r\n美国电影协会评选的“100名银幕英雄与恶人”中，派克主演的芬奇律师名列英雄第一位。\r\n作为史上最受喜爱的小说之一，《杀死一只知更鸟》已获得显赫声誉。它赢得过普利策奖，被翻译成四十多种语言，在世界范围内售出超过三千万册，并曾被拍成，备受欢迎的电影。\r\n——哈珀•柯林斯出版集团', '', '第一部 　　第一章 　　我哥哥杰姆快十三岁时，胳膊肘严重骨折。等到痊愈，他再也不能玩橄榄球的恐惧也消失了，便很少意识到自己的伤残。他的左臂比右臂短了些；当他站立或行走时，他那只手的手背与身体便摆成了直角，拇指和大腿平行。他对此毫不在意，只要他还能传球，开球。 　　又过了几年，等两人能够回首往事时，我们有时会谈论导致他受伤的那些事件。我坚持认为，是尤厄尔家的人...', '{\"small\":\"https://www.library-online.cn/imgs/9787544722766.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL),
(15007, '巨人的陨落', '\"\"', '\"\"', '\"\"', '9787539989891', '\"\"', '江苏凤凰文艺出版社', '1993-12-20', 'ZZZ', '', '[\"[英] 肯·福莱特 \"]', '[]', '', '', '', 129.8, 1168, 647, '在第一次世界大战的硝烟中，每一个迈向死亡的生命都在热烈地生长——威尔士的矿工少年、刚失恋的美国法律系大学生、穷困潦倒的俄国兄弟、富有英俊的英格兰伯爵，以及痴情的德国特工… 从充满灰尘和危险的煤矿到闪闪发光的皇室宫殿，从代表着权力的走廊到爱恨纠缠的卧室，五个家族迥然不同又纠葛不断的命运逐渐揭晓，波澜壮阔地展现了一个我们自认为了解，但从未如此真切感受过的20世纪。', '序 成人礼\r\nPart 1 天地失色\r\nPart 2 巨人之战\r\nPart 3 世界重生', '英王乔治五世在伦敦威斯敏斯特教堂加冕那天，比利・威廉姆斯在南威尔士的阿伯罗温下了矿井。 1911年6月21日是比利的十三岁生日。他是被父亲叫醒的。爸爸的方法很管用，但不温柔。他拍着比利的脸颊，节奏平稳，坚定执着。比利睡得很深，一开始不打算理会，但那拍打无情地 持续着。他觉得很生气，但马上意识到必须起了，甚至自己想起床，于是他睁开眼睛，一个激灵坐了起来。 “四点了..', '{\"small\":\"https://www.library-online.cn/imgs/9787539989891.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL),
(15008, '解忧杂货店', '\"\"', '\"\"', '\"\"', '9787544270878', '\"\"', '南海出版公司', '2008-05-05', 'ZZZ', '', '[\"[日] 东野圭吾 \"]', '[]', '', '', '', 39.5, 291, 371, '现代人内心流失的东西，这家杂货店能帮你找回——\r\n僻静的街道旁有一家杂货店，只要写下烦恼投进卷帘门的投信口，第二天就会在店后的牛奶箱里得到回答。\r\n因男友身患绝症，年轻女孩静子在爱情与梦想间徘徊；克郎为了音乐梦想离家漂泊，却在现实中寸步难行；少年浩介面临家庭巨变，挣扎在亲情与未来的迷茫中……\r\n他们将困惑写成信投进杂货店，随即奇妙的事情竟不断发生。\r\n生命中的一次偶然交会，将如何演绎出截然不同的人生？\r\n如今回顾写作过程，我发现自己始终在思考一个问题：站在人生的岔路口，人究竟应该怎么做？我希望读者能在掩卷时喃喃自语：我从未读过这样的小说。——东野圭吾', '第一章 回答在牛奶箱里\r\n第二章 深夜的口琴声\r\n第三章 在思域车上等到天亮\r\n第四章 听着披头士默祷\r\n第五章 来自天上的祈祷', '', '{\"small\":\"https://www.library-online.cn/imgs/9787544270878.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL),
(15009, '囚鸟', '\"\"', '\"\"', '\"\"', '9787550022348', '\"\"', '百花洲文艺出版社', '1998-09-08', 'ZZZ', '', '[\"[美] 库尔特·冯内古特 \"]', '[]', '', '', '', 38, 304, 531, '我们都是受困于时代的“囚鸟”——既渴望逃离，又踟蹰不前。\r\n联邦最低限度安保措施成人改造所里，颓唐的小老头儿瓦尔特•斯代布克正在等待领他出狱的狱卒。\r\n在他过去的人生中，他曾是斯拉夫移民的儿子，哈佛大学毕业生，前共产党党员，前联邦政府官员，“水门事件”的涉案者……\r\n不久他还将获得一个新的身份，神秘的……', '冯内古特和他的《囚鸟》\r\n序幕\r\n囚鸟（1-23章）\r\n尾声', '父亲的故事 选自：《囚鸟》 作者：冯内古特 亚力克斯叔叔和我坐在斯特格梅耶酒店，要了啤酒，等待父亲和哈柏古的驾临。他们说好分开来的，因为要是他们一起来，路上肯定没什么话可说。那时父亲已对政治啦、历史啦、经济啦等等完全失去了兴趣。他常说，空谈太多。对他来说，感觉比观点更有意义—特别是手指触摸自然物体的感觉。二十年后他临死时还说，他后悔没有当陶工，那样就可以一...', '{\"small\":\"https://www.library-online.cn/imgs/9787550022348.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL),
(15010, '1984', '\"\"', '\"\"', '\"\"', '9787530210291', '\"\"', '北京十月文艺出版社', '2005-07-13', 'ZZZ', '', '[\"[英] 乔治·奥威尔 \"]', '[]', '', '', '', 28, 304, 581, '★村上春树以《1Q84》向本书致敬\r\n★著名学者刘绍铭经典译本内地首次出版\r\n★62种文字风靡110个国家，全球销量超过5000万册\r\n★《时代周刊》“最好的100本英语小说”\r\n★兰登书屋“100本20世纪最佳英语小说”\r\n★入选英美中学生必读书书目\r\n1936年以来，我所写的每一部严肃作品，都是直接或间接地反对极权主义，支持我所理解的民主社会主义。 ——乔治•奥威尔（《我为何写作》）\r\n《1984》是一部杰出的政治寓言小说，也是一部幻想小说。作品刻画了人类在极权主义社会的生存状态，有若一个永不退色的警示标签，警醒世人提防这种预想中的黑暗成为现实。历经几十年，其生命力益显强大，被誉为20世纪影响最为深远的文学经典之一。', '', '', '{\"small\":\"https://www.library-online.cn/imgs/9787530210291.jpg\"}', '2018-04-28 21:11:50', '2018-05-16 14:07:07', NULL);
